import React from "react";
// import App from './App'
import { CarouselProvider, Slider } from "pure-react-carousel";
import CustomCardSlide from "../components/CustomCardSlide";
import CustomDotGroup from "../components/CustomDotGroup";
import Header from "semantic-ui-react"

function CardCarousel(props) {
  
  let carousel =
  <CarouselProvider
    naturalSlideWidth={1}
    naturalSlideHeight={1.25}
    totalSlides={3}
    style={{ width: "300px" }}
  >

    return 
    <Slider>
      <CustomCardSlide
        Header={props.name}
        height = {`{props.name} is about {props.height} give or take a few inches.}`}
        index={0}
        hair = {props.hair}
        age ={` We believe, {props.name} was born or came into being on {props.birthYear}`}
       
      />
     
    </Slider>

    <CustomDotGroup slides={3} />
  </CarouselProvider>

}
export default CardCarousel;
